import React from 'react';
import './Button.css';

const NumberButton = props => {
  return <div>

  {props.theNumbers.aNumber}

  {theNumbers.map(numberFromMap => (
          <NumberButton number={numberFromMap} key={numberFromMap.aNumber} />
        ))}

  </div>;
};

export default NumberButton;
